import React, { useEffect, useState } from 'react';
import './style.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Destinations from './components/Destinations';
import Slide from './components/Slide';
import Block from './components/Block';
import Story from './components/Story';
import Featured from './components/Featured';
import Explore from './components/Explore';
import Footer from './components/Footer';

function App() {
  const openLink = (url) => {
    window.open(url, '_blank');
  };

  const [navbarOpen, setNavbarOpen] = useState(false);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    window.addEventListener("load", () => {
      setTimeout(() => {
        setLoading(false);
      }, 5000); 
    });

    return () => {
      window.removeEventListener("load", () => {});
    };
  }, []);

  return (
    <div className="App">
      {loading ? (
        <div id="loading-screen">
          <div className="loading-dots">
            <span></span>
            <span></span>
            <span></span>
            <span></span>
            <span></span>
          </div>
        </div>
      ) : (
        <>
          <nav className="top-bar">
            <div className="h">
              <h1>We`blog</h1>
            </div>
            <button className="nav-toggle" onClick={() => setNavbarOpen(!navbarOpen)}>
              {navbarOpen ? <i className="fa fa-times"></i> : <i className="fa fa-bars"></i>}
            </button>
            <div className={`nav-menu ${navbarOpen ? 'show' : ''}`}>
              <div className="mainbuttons">
                <button className="b1" type="button" onClick={() => openLink('/')}>Home</button>
                <button className="b1" type="button" onClick={() => openLink('/about')}>About</button>
                <button className="b1" type="button">Travel</button>
                <button className="b1" type="button">Relax</button>
                <button className="b1" type="button">Eat</button>
              </div>
              <div className="social-icons">
                <button className="b2" type="button" onClick={() => openLink('https://www.instagram.com/')}>
                  <i className="fa fa-instagram"></i>
                </button>
                <button className="b2" type="button" onClick={() => openLink('https://www.pinterest.com/')}>
                  <i className="fa fa-pinterest"></i>
                </button>
                <button className="b2" type="button" onClick={() => openLink('https://www.facebook.com/')}>
                  <i className="fa fa-facebook"></i>
                </button>
                <button className="b2" type="button" onClick={() => openLink('https://twitter.com/')}>
                  <i className="fa fa-twitter"></i>
                </button>
              </div>
              <div className="Search1">
                <section className="search-button">
                  <input type="text" id="input" placeholder="Search..." />
                  <button type="button">
                    <i className="fa fa-search"></i>
                  </button>
                </section>
              </div>
            </div>
          </nav>

          <div className="imgcontainer">
            <img src="images/Denmark-GettyImages-587892190.webp" alt="Front" className="FrontImg1" />
            <div className="imgcontent">
              <h2>Travel Blogs</h2>
            </div>
          </div>

          <div className="ct">
            <p>
              Terrace bar beckons you to indulge in an evening of refined relaxation and exquisite enjoyment. Step
              into our haven of tranquility, where the soft glow of ambient lighting and the gentle rustle of foliage
              create an inviting atmosphere. Whether you're seeking a quiet retreat or a lively soirée, our terrace bar
              offers the perfect setting. Sip on handcrafted cocktails expertly crafted by our skilled bartenders, or
tantalize your taste buds with our delectable menu of small bites and snacks....
            </p>
          </div>

          <Slide />

          <Featured />

          <Router>
            <Routes className="block">
              <Route path="/" element={<Block />} />
              <Route path="/story" element={<Story />} />
            </Routes>
          </Router>
          <div className="Arena">
            <div className="line-above"></div>
            <div className="ted">Destination Guides</div>
          </div>

          <Destinations />

          <div className="Arena2">
            <div className="line-above">
            </div>
            <Explore />
          </div>

          <Footer />
        </>
      )}
    </div>
  );
}

export default App;
